import './App.css';
import React, { useState } from 'react';
function Todo({ todo }) {
  return (
    <div className="todo">
      {todo.text}
    </div>
  );
};
function App() {
  const [todos,SetTodos] = useState([
    { text: "Learn about React" },
    { text: "Meet friend for lunch" },
    { text: "Build really cool todo app" }

  ])


  return (
    <div className="App">
       {todos.map((todo, index) => (
          <Todo
            key={index}
            index={index}
            todo={todo}
          />
        ))} 
    </div>
  );
}

export default App;
